import React from "react";
import { Link } from "react-router-dom";
const url = "https://i.etsystatic.com/30791951/r/il/dcd9c4/3442146427/il_1588xN.3442146427_lb34.jpg"
const Navbar = () => {
    <div className = "nav bg-grey w-100 h-80">
         <img src = {url} alt = "Logo" className = "logo" Link to = "/"/>
         <Link to = "/contact"> <h5 classname = "disclaimer" > CONTATTACI PER IL TUO MATRIMONIO </h5> </Link>
    </div>
}

export default Navbar;
